import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';  // Add your specific CSS for Header here

const Header = () => {
  return (
    <header className="header">
      <h1 className="title">Finique</h1>
      <nav className="nav">
        <ul>
          <li>Services</li>
          <li>About us</li>
          <li>
            <Link to="/signup">
              <button className="sign-up-button">Sign Up</button>
            </Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
